import BaseLayout from "../components/BaseLayout";
import FoldersHeaderBar from "../components/FoldersHeaderBar";
import MenuBlock from "../components/MenuBlock";
import { Container, Row, Col } from "react-bootstrap";

const Cudzoziemcy = () => {
  return (
    <BaseLayout title="Katalog spraw">
      <Container className="wrapper">
        <Row className="grey-box">
          <FoldersHeaderBar />
        </Row>
        <Row className="grey-box">
          <div className="">
            <h1>Wybierz swoje pochodzenie</h1>
          </div>

          <Row>
            <Col>
              <MenuBlock title="obywatele ur (oraz eog/szwajcarii) i członkowie ich rodzin" />
            </Col>
            <Col>
              <MenuBlock title="obywatele państw trzecich" />
            </Col>
          </Row>
          <Row></Row>
        </Row>
      </Container>
    </BaseLayout>
  );
};

export default Cudzoziemcy;
